import { useCallback, useState } from "react";
import { Linking, Pressable, ScrollView, Switch, Text, TextInput, View } from "react-native";
import { useColorScheme } from "nativewind";
import Constants from "expo-constants";
import {
  areAudioCuesEnabled,
  setAudioCuesEnabled,
} from "@/src/utils/audioCues";
import { useWhisperKit } from "@/src/hooks/useWhisperKit";
import {
  useLocalWhisper,
  useLanguage,
  useAgentName,
  useReasoningProvider,
  useReasoningModel,
  useReasoningEnabled,
  useCloudTranscriptionProvider,
  useCloudTranscriptionModel,
  useTheme,
} from "@/src/hooks/useSettings";
import { ModelPicker } from "@/src/components/ModelPicker";
import { ApiKeyInput } from "@/src/components/ApiKeyInput";
import { SettingsSection } from "@/src/components/SettingsSection";
import { PickerSelect } from "@/src/components/PickerSelect";
import { DictionaryManager } from "@/src/components/DictionaryManager";
import { SecureKeys } from "@/src/storage/secureStorage";
import {
  getTranscriptionProviders,
  getReasoningProviders,
  getTranscriptionProvider,
  getReasoningProvider,
} from "@/src/models/ModelRegistry";

const LANGUAGES = [
  { value: "auto", label: "Auto-detect" },
  { value: "en", label: "English" },
  { value: "es", label: "Spanish" },
  { value: "fr", label: "French" },
  { value: "de", label: "German" },
  { value: "it", label: "Italian" },
  { value: "pt", label: "Portuguese" },
  { value: "zh", label: "Chinese" },
  { value: "ja", label: "Japanese" },
  { value: "ko", label: "Korean" },
  { value: "nl", label: "Dutch" },
  { value: "pl", label: "Polish" },
  { value: "ru", label: "Russian" },
  { value: "sv", label: "Swedish" },
  { value: "tr", label: "Turkish" },
  { value: "ar", label: "Arabic" },
  { value: "hi", label: "Hindi" },
];

export default function SettingsScreen() {
  const {
    availableModels,
    currentModel,
    recommendedModel,
    downloadProgress,
    isLoading,
    initialize,
    downloadModel,
    deleteModel,
  } = useWhisperKit();

  const [useLocal, setUseLocal] = useLocalWhisper();
  const [language, setLanguage] = useLanguage();
  const [agentName, setAgentName] = useAgentName();
  const [reasoningProvider, setReasoningProvider] = useReasoningProvider();
  const [reasoningModel, setReasoningModel] = useReasoningModel();
  const [reasoningEnabled, setReasoningEnabled] = useReasoningEnabled();
  const [cloudProvider, setCloudProvider] = useCloudTranscriptionProvider();
  const [cloudModel, setCloudModel] = useCloudTranscriptionModel();
  const [theme, setThemeSetting] = useTheme();
  const { setColorScheme } = useColorScheme();
  const [audioCues, setAudioCues] = useState(areAudioCuesEnabled);

  const handleThemeChange = useCallback(
    (value: string) => {
      setThemeSetting(value);
      if (value === "light" || value === "dark") {
        setColorScheme(value);
      } else {
        setColorScheme("system");
      }
    },
    [setThemeSetting, setColorScheme]
  );

  // Build options from model registry
  const transcriptionProviderOptions = getTranscriptionProviders().map((p) => ({
    value: p.id,
    label: p.name,
  }));

  const selectedTranscriptionProvider = getTranscriptionProvider(
    cloudProvider ?? "openai"
  );
  const transcriptionModelOptions = (
    selectedTranscriptionProvider?.models ?? []
  ).map((m) => ({
    value: m.id,
    label: m.name,
    description: m.description,
  }));

  const reasoningProviderOptions = getReasoningProviders().map((p) => ({
    value: p.id,
    label: p.name,
  }));

  const selectedReasoningProvider = getReasoningProvider(
    reasoningProvider ?? "openai"
  );
  const reasoningModelOptions = (
    selectedReasoningProvider?.models ?? []
  ).map((m) => ({
    value: m.id,
    label: m.name,
    description: m.description,
  }));

  const handleCloudProviderChange = useCallback(
    (value: string) => {
      setCloudProvider(value);
      // Reset model when provider changes
      const provider = getTranscriptionProvider(value);
      if (provider?.models[0]) {
        setCloudModel(provider.models[0].id);
      }
    },
    [setCloudProvider, setCloudModel]
  );

  const handleReasoningProviderChange = useCallback(
    (value: string) => {
      setReasoningProvider(value);
      const provider = getReasoningProvider(value);
      if (provider?.models[0]) {
        setReasoningModel(provider.models[0].id);
      }
    },
    [setReasoningProvider, setReasoningModel]
  );

  return (
    <ScrollView className="flex-1 bg-white dark:bg-black">
      {/* Transcription Mode */}
      <SettingsSection
        title="Transcription"
        subtitle="Choose how audio is transcribed"
      >
        <View className="flex-row items-center justify-between mb-4">
          <View className="flex-1">
            <Text className="text-base font-medium text-gray-800 dark:text-gray-200">
              Use local model
            </Text>
            <Text className="text-xs text-gray-500 mt-1">
              On-device with WhisperKit (private, no internet)
            </Text>
          </View>
          <Switch
            value={useLocal}
            onValueChange={setUseLocal}
            trackColor={{ false: "#d1d5db", true: "#3b82f6" }}
            accessibilityLabel="Use local transcription model"
          />
        </View>

        {!useLocal && (
          <>
            <PickerSelect
              label="Cloud Provider"
              options={transcriptionProviderOptions}
              value={cloudProvider ?? "openai"}
              onChange={handleCloudProviderChange}
            />
            <PickerSelect
              label="Transcription Model"
              options={transcriptionModelOptions}
              value={cloudModel}
              onChange={setCloudModel}
            />
          </>
        )}

        <PickerSelect
          label="Language"
          options={LANGUAGES}
          value={language ?? "auto"}
          onChange={setLanguage}
        />
      </SettingsSection>

      {/* WhisperKit Models  show when local mode is on */}
      {useLocal && (
        <ModelPicker
          models={availableModels}
          currentModel={currentModel}
          recommendedModel={recommendedModel}
          downloadProgress={downloadProgress}
          isInitializing={isLoading}
          onSelect={initialize}
          onDownload={downloadModel}
          onDelete={deleteModel}
        />
      )}

      {/* AI Reasoning */}
      <SettingsSection
        title="AI Text Processing"
        subtitle="Clean up and enhance transcribed text with AI"
      >
        <View className="flex-row items-center justify-between mb-4">
          <View className="flex-1">
            <Text className="text-base font-medium text-gray-800 dark:text-gray-200">
              Enable AI processing
            </Text>
            <Text className="text-xs text-gray-500 mt-1">
              Cleanup, agent commands, and text enhancement
            </Text>
          </View>
          <Switch
            value={reasoningEnabled}
            onValueChange={setReasoningEnabled}
            trackColor={{ false: "#d1d5db", true: "#3b82f6" }}
            accessibilityLabel="Enable AI text processing"
          />
        </View>

        {reasoningEnabled && (
          <>
            <PickerSelect
              label="AI Provider"
              options={reasoningProviderOptions}
              value={reasoningProvider ?? "openai"}
              onChange={handleReasoningProviderChange}
            />
            <PickerSelect
              label="AI Model"
              options={reasoningModelOptions}
              value={reasoningModel}
              onChange={setReasoningModel}
            />
            <View className="mb-3">
              <Text className="text-sm font-semibold text-gray-700 mb-1.5">
                Agent Name
              </Text>
              <TextInput
                className="border border-gray-300 rounded-lg px-3 py-2.5 text-sm text-gray-900 bg-white"
                value={agentName ?? ""}
                onChangeText={setAgentName}
                placeholder='e.g. "Aria"'
                placeholderTextColor="#9ca3af"
                autoCapitalize="words"
                autoCorrect={false}
              />
              <Text className="text-xs text-gray-400 mt-1">
                Say "Hey [name]" to activate agent mode
              </Text>
            </View>
          </>
        )}
      </SettingsSection>

      {/* Custom Dictionary */}
      <SettingsSection
        title="Custom Dictionary"
        subtitle="Improve transcription accuracy for specific words"
      >
        <DictionaryManager />
      </SettingsSection>

      {/* API Keys */}
      <SettingsSection
        title="API Keys"
        subtitle="Stored securely in iOS Keychain"
      >
        <ApiKeyInput
          label="OpenAI"
          secureKey={SecureKeys.OPENAI_API_KEY}
          placeholder="sk-..."
        />
        <ApiKeyInput
          label="Anthropic"
          secureKey={SecureKeys.ANTHROPIC_API_KEY}
          placeholder="sk-ant-..."
        />
        <ApiKeyInput
          label="Google Gemini"
          secureKey={SecureKeys.GEMINI_API_KEY}
          placeholder="AI..."
        />
        <ApiKeyInput
          label="Groq"
          secureKey={SecureKeys.GROQ_API_KEY}
          placeholder="gsk_..."
        />
        <ApiKeyInput
          label="Mistral"
          secureKey={SecureKeys.MISTRAL_API_KEY}
          placeholder="..."
        />
      </SettingsSection>

      {/* Appearance */}
      <SettingsSection
        title="Appearance"
        subtitle="Customize the app's look"
      >
        <PickerSelect
          label="Theme"
          options={[
            { value: "auto", label: "System" },
            { value: "light", label: "Light" },
            { value: "dark", label: "Dark" },
          ]}
          value={theme ?? "auto"}
          onChange={handleThemeChange}
        />

        <View className="flex-row items-center justify-between mt-3">
          <View className="flex-1">
            <Text className="text-base font-medium text-gray-800 dark:text-gray-200">
              Audio cues
            </Text>
            <Text className="text-xs text-gray-500 mt-1">
              Play sounds when recording starts and stops
            </Text>
          </View>
          <Switch
            value={audioCues}
            onValueChange={(value) => {
              setAudioCues(value);
              setAudioCuesEnabled(value);
            }}
            trackColor={{ false: "#d1d5db", true: "#3b82f6" }}
            accessibilityLabel="Toggle audio cues"
          />
        </View>
      </SettingsSection>

      {/* Keyboard Extension */}
      <SettingsSection
        title="Keyboard Extension"
        subtitle="Dictate from any app"
      >
        <View className="bg-gray-50 dark:bg-gray-900 rounded-xl p-4 mb-3" style={{ borderCurve: "continuous" as const }}>
          <Text className="text-sm font-semibold text-gray-800 dark:text-gray-200 mb-2">
            Setup instructions:
          </Text>
          {[
            "Settings  General  Keyboard  Keyboards",
            'Add New Keyboard  "OpenWhispr Voice"',
            "Tap OpenWhispr Voice  Enable Full Access",
          ].map((text, i) => (
            <Text
              key={i}
              className="text-xs text-gray-500 dark:text-gray-400 mb-1"
            >
              {i + 1}. {text}
            </Text>
          ))}
        </View>
        <Pressable
          onPress={() => Linking.openSettings()}
          className="bg-blue-500 rounded-lg py-3 active:opacity-80"
          style={{ borderCurve: "continuous" as const }}
        >
          <Text className="text-white font-semibold text-sm text-center">
            Open Settings
          </Text>
        </Pressable>
      </SettingsSection>

      {/* About */}
      <SettingsSection title="About" subtitle="App information">
        <View className="flex-row justify-between items-center mb-2">
          <Text className="text-sm text-gray-600 dark:text-gray-400">
            Version
          </Text>
          <Text className="text-sm text-gray-900 dark:text-white">
            {Constants.expoConfig?.version ?? "1.0.0"}
          </Text>
        </View>
        <View className="flex-row justify-between items-center mb-2">
          <Text className="text-sm text-gray-600 dark:text-gray-400">
            Build
          </Text>
          <Text className="text-sm text-gray-900 dark:text-white">
            {Constants.expoConfig?.ios?.buildNumber ?? "1"}
          </Text>
        </View>
        <Text className="text-xs text-gray-400 mt-2 text-center">
          OpenWhispr  Private, on-device dictation
        </Text>
      </SettingsSection>

      <View className="h-8" />
    </ScrollView>
  );
}

